import React from "react";
import { useState, useEffect } from "react";
import { Table } from "antd";
import { useNavigate, useParams } from "react-router-dom";
import { allCollections } from "../collectionsFile"


function Address() {
  const [txs, setTxs] = useState();
  const [collectionData, setCollectionData] = useState();
  const { address, collection } = useParams();

  useEffect(() => {

    const result = allCollections.filter((obj) => {
      return obj.slug === collection;
    });

    setCollectionData(result[0]);
  }, [collection, address]);


  const columns = [
    {
      title: "Event",
      dataIndex: "from",
    },
    {
      title: "Token ID",
      dataIndex: "tokenId",
    },
    {
      title: "Price",
      dataIndex: "price",
    },
    {
      title: "Date",
      dataIndex: "date",
    },
    {
      title: "To",
      dataIndex: "to",
    },
    {
      title: "From",
      dataIndex: "from",
    },
  ];

  return (
    <>
    {collectionData && (
      <div className="userTitle">
        <div>
          <img src={collectionData.img} alt="colLogo" className="logoImg" />
          {collectionData.name}
        </div>
        <div className="wallet">
          {`${address.slice(0, 6)}...${address}`}

        </div>

      </div>
    )}
      <div className="App">
        <div className="tableContainer">
          <Table columns={columns} dataSource={txs} />
        </div>
      </div>
    </>
  );
}

export default Address;
